document.addEventListener('DOMContentLoaded', () => {
  const foodList = document.getElementById('foodList');
  const searchInput = document.getElementById('foodSearch');
  const cartCount = document.getElementById('foodCartCount');
  let cartItems = 0;

  const foods = [
    { id: 1, name: 'Chicken Biriyani', description: 'Spiced rice with tender chicken.', price: 14.99, image: 'https://via.placeholder.com/150' },
    { id: 2, name: 'Vegetable Fried Rice', description: 'Stir-fried rice with mixed veggies.', price: 8.99, image: 'https://via.placeholder.com/150' },
    { id: 3, name: 'Pizza Margherita', description: 'Tomato, mozzarella, and basil.', price: 12.99, image: 'https://via.placeholder.com/150' },
    { id: 4, name: 'Cheese Burger', description: 'Beef patty with cheddar and veggies.', price: 9.99, image: 'https://via.placeholder.com/150' },
    { id: 5, name: 'Butter Chicken', description: 'Creamy tomato-based chicken curry.', price: 13.99, image: 'https://via.placeholder.com/150' }
  ];

  function renderFoods(items) {
    foodList.innerHTML = items.map(item => `
      <div class="food-card">
        <img src="${item.image}" alt="${item.name}">
        <h3>${item.name}</h3>
        <p>${item.description}</p>
        <span>$${item.price.toFixed(2)}</span>
        <button class="add-btn" data-id="${item.id}">Add</button>
        <button class="remove-btn" data-id="${item.id}">Remove</button>
      </div>
    `).join('');
  }

  renderFoods(foods);

  // Search filter
  searchInput.addEventListener('input', () => {
    const term = searchInput.value.toLowerCase();
    const filtered = foods.filter(item =>
      item.name.toLowerCase().includes(term) || item.description.toLowerCase().includes(term)
    );
    renderFoods(filtered);
  });

  // Add & Remove from cart
  document.addEventListener('click', (e) => {
    if (e.target.classList.contains('add-btn')) {
      cartItems++;
      cartCount.textContent = cartItems;
    } else if (e.target.classList.contains('remove-btn')) {
      if (cartItems > 0) {
        cartItems--;
        cartCount.textContent = cartItems;
      }
    }
  });
});




document.addEventListener('DOMContentLoaded', () => {
    // Menu data as an array of objects
    const menuItems = [
        {
            id: 1,
            name: "Hearty Oats",
            category: "breakfast",
            description: "A warm bowl of oats topped with fresh berries and honey.",
            price: 8.50,
            image:" data:image/jpeg;base64,"
        },
        {
            id: 2,
            name: "Classic Pancakes",
            category: "breakfast",
            description: "Fluffy pancakes with maple syrup and butter.",
            price: 10.00,
            image: "data:image/jpeg;base64,"
        },
        {
            id: 3,
            name: "Grilled Chicken Salad",
            category: "lunch",
            description: "Fresh greens with grilled chicken breast and a light dressing.",
            price: 15.75,
            image: "data:image/jpeg;base64,"
        },
        {
            id: 4,
            name: "Club Sandwich",
            category: "lunch",
            description: "Turkey, bacon, lettuce, and tomato on toasted bread.",
            price: 12.99,
            image: "data:image/jpeg;base64,"
        },
        {
            id: 5,
            name: "Ribeye Steak",
            category: "dinner",
            description: "Juicy ribeye steak, grilled to perfection with roasted vegetables.",
            price: 25.50,
            image: "data:image/jpeg;base64,"
        },
        {
            id: 6,
            name: "Seafood Pasta",
            category: "dinner",
            description: "Linguine with shrimp and scallops in a creamy garlic sauce.",
            price: 22.00,
            image: "data:image/jpeg;base64,"
        }
    ];

    const menuGrid = document.querySelector('.menu-grid');
    const tabButtons = document.querySelectorAll('.tab-button');

    // Function to render menu items based on a category
    function renderMenuItems(category) {
        menuGrid.innerHTML = ''; // Clear existing cards
        const filteredItems = category === 'all' ? menuItems : menuItems.filter(item => item.category === category);

        filteredItems.forEach(item => {
            const card = document.createElement('div');
            card.classList.add('menu-card', item.category, 'all');
            card.innerHTML = `
                <img src="${item.image}" alt="${item.name}">
                <div class="card-content">
                    <h3>${item.name}</h3>
                    <p>${item.description}</p>
                    <span class="price">$${item.price.toFixed(2)}</span>
                </div>
            `;
            menuGrid.appendChild(card);
        });
    }

    // Event listeners for tab buttons
    tabButtons.forEach(button => {
        button.addEventListener('click', () => {
            // Remove active class from all buttons
            tabButtons.forEach(btn => btn.classList.remove('active'));
            // Add active class to the clicked button
            button.classList.add('active');

            const category = button.dataset.category;
            renderMenuItems(category);
        });
    });

    // Initial render of all items
    renderMenuItems('all');
});




